  Bering Sea from 2016-08-10 to 2016-08-27. These data include CONDUCTIVITY, HYDROSTATIC
  PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE. The instruments
  used to collect these data include CTD. These data were collected and submitted
  by the NOAA Office of Coast Survey in support of hydrographic multibeam surveys
  to meet NOAA charting requirements.\",\n\t\"license_title\": null,\n\t\"extras\":
